    true,nt"url": null,nt"notes": "EDFacts Financial Data, 2010-11 (EDFacts
    FD:2010-11), is one of 17 'topics' identified in the EDFacts documentation (in this
    database, each 'topic' is entered as a separate study); program data is available
    since 2005 at <ed.gov/about/inits/ed/edfacts>. EDFacts FD:2010-11 (ed.gov/about/inits/ed/edfacts)
    annually collects cross-sectional data from states about financial data on distribution
    of funds and funding status at LEA level. EDFacts FD:2010-11 data were collected
    using the EDFacts Submission System (ESS), a centralized portal and their submission
    by states is mandatory and required for benefits. Not submitting the required reports
    by a state constitutes a failure to comply with law and may have consequences for
    federal funding to the state. Key statistics produced from EDFacts FD:2010-11 are
    from 2 data groups with information on Federal Programs and REAP Alternative Funding
    Status. For the purposes of this system, data groups are referred to as 'variables',
    as a result of the structure and format of EDFacts' data.",nt"owner_org": "8c0bc869-1189-4ced-af26-2abd2337b886",nt"extras":
